import { React, Component } from 'react';


import './styles/Cart.css';


class Cart extends Component {
      constructor(props) {
        super(props);
      }
    render() {
        let i = 0;
      return (
        <div className='cart-container'>
          <div className='heading-container'>
          <h1>CART</h1>
          </div>
          <div key={index} className='cart'>
          {console.log(product[0])}
        <div className='cart-titles'>
          <h1>{product[0].name}</h1>
           <h2>{product.brand}</h2>
          <h3>$</h3>
          <div className='sizes-btn'>
            <button className='btn-hover btn-size'>S</button>
            <button className='btn-hover btn-size'>M</button>
          </div>
        </div>
        <div className='cart-imgs'>
          <div className='cart-counters'>
            <button className='btn-hover'>+</button>
            <p>1</p>
            <button className='btn-hover'>-</button>
          </div>
          <img alt='' src=""></img> 
        </div>
        {i++}
      </div>
{/* 
            <h1>
              <h1>{this.props.selectedProduct[0].itemId}{this.props.selectedProduct[1].itemId}</h1>
            </h1> */}
        </div>
      ) 
    }
  }

  export default Cart;
